import React from "react";
import '../App.css';
import CreateRace from './CreateRace';
import SingUp from './SingUp';
import Login from './Login';
import AddCircuit from "./AddCircuit";

function Home() {
  return (
      <div className="main">
          <Login/>
          <CreateRace/>
          <SingUp/>
          <AddCircuit/>
      </div>
  );
}

export default Home;
